#include <bits/stdc++.h>using namespace std; using ll = long long;using vi = vector<ll>;using vl = vector<ll>;using pii = pair<int, int>;using pll = pair<ll, ll>;using vpii = vector<pii>;using vpll = vector<pll>; void solve() {    ll n;    cin>>n;    vector<ll> arr(n);    for(int i=0;i<n;i++){        cin>>arr[i];    }    map <ll,ll> mpp;    for(int i=0;i<n;i++){        mpp[arr[i]]++;    }    for(auto ele:mpp){        if (ele.second>1){            cout<<"YES"<<endl;            return;        }    }    cout<<"NO"<<endl; } int main() {    ios_base::sync_with_stdio(false);    cin.tie(NULL);    cout.tie(NULL);     ll t;    cin >> t;    while (t--) {        solve();    }    return 0;}